import{_ as e,o as t,c as o,R as c}from"./chunks/framework.3LEfkZv-.js";const r="/assets/140f627298b4b166263a7799d085c33e.WfXi0c2D.png",f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/git/回退到指定版本.md","filePath":"docs/git/回退到指定版本.md","lastUpdated":1702732998000}'),i={name:"docs/git/回退到指定版本.md"},a=c('<blockquote><p>参考： <a href="https://juejin.cn/post/7225126264663654461" target="_blank" rel="noreferrer">https://juejin.cn/post/7225126264663654461</a></p></blockquote><p>回退到指定版本有两种方式：<code>git reset</code>和<code>git revert</code>，其中<code>git reset</code>方法回退版本后，被回退的那些提交历史就都没有了。而<code>git revert</code>方法回退版本后，会增加一次commit历史，表示回退过版本。</p><h3 id="git-revert" tabindex="-1">git revert <a class="header-anchor" href="#git-revert" aria-label="Permalink to &quot;git revert&quot;">​</a></h3><p>使用方法：<code>git revert commitID</code>表示将这个commitID的提交撤销，也就是回退到这个commitID<strong>之前</strong>的状态，而不是回退到这个commitID的状态。commitID可以通过<code>git log</code>命令查看。<br>如下图每次提交增加一个数字，所以如果revert <code>commitID为di2</code>的那次提交，则<code>1.txt</code>文件中的内容<code>只剩下数字1</code>。在做测试时，发现revert相邻的commitID时基本不会产生冲突，但是revert间隔的commitID时基本都会产生冲突。<br><img src="'+r+'" alt="image.png"></p>',4),d=[a];function s(_,n,m,p,g,l){return t(),o("div",null,d)}const v=e(i,[["render",s]]);export{f as __pageData,v as default};
